import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = () => {
    return (
        <div className={s.dialog + " " + s.active}>
            <NavLink to="/dialogs/1" className = { navData => navData.isActive ? s.active : s.dialog }>Alex</NavLink>
        </div>

    )
}
const Dialogs = () => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/2" className = { navData => navData.isActive ? s.active : s.dialog }>Luda</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/3" className = { navData => navData.isActive ? s.active : s.dialog }>Petro</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/4" className = { navData => navData.isActive ? s.active : s.dialog }>Anna</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/5" className = { navData => navData.isActive ? s.active : s.dialog }>Artem</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/6" className = { navData => navData.isActive ? s.active : s.dialog }>Dima</NavLink>
                </div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi</div>
                <div className={s.message}>How are you?</div>
                <div className={s.message}>Oh, i'm ok, and you?</div>
            </div>
        </div>
    )
}

export default Dialogs;
